import { useEffect, useState } from 'react'
import FunilCards from '../../../components/CampaingElements/Funil/FunilCards'
import FunilLine from '../../../components/CampaingElements/Funil/FunilLine'
import ClickModel from '../../../models/click'
import { User } from '../../../models/user'
import { Container, TabHeader, FiltersContainer } from './styles'
import { CampaingSummaryModel } from '../../../models/campaing-summary'
import Loading from '../../../components/Loading'

interface Props {
  user?: User []
  clicks: ClickModel[]
}

const ClicksTab = ({ user, clicks }: Props) => {
  const [showClicks, setShowClicks] = useState<ClickModel[]>(clicks)
  const [filteredSummary, setFilteredSummary] = useState<CampaingSummaryModel>()

  useEffect(() => {

  }, [showClicks])

  return (
    <Container>
      <TabHeader>
        <FiltersContainer>

        </FiltersContainer>

       {filteredSummary? (
        <>
          <FunilCards campaingSummary={filteredSummary} />
          <FunilLine campaingSummary={filteredSummary}  color={'#747373'} />
        </>
       ) : (
        <Loading />
       )}
      </TabHeader>
    </Container>
  )
}

export default ClicksTab
